    "store": {"changelog.html":{"url":"changelog.html","title":"getting-started - changelog","body":"\n                   \n\nChangelog\nAll notable changes to this project will be documented in this file.\nThe format is based on Keep a Changelog,\nand this project adheres to Semantic Versioning.\n[Unreleased]\n[Released]\n[2.2.1]\nChanged\n\nRestructured the project by jrquick17\n\n[2.2.0]\nRemoved\n\nmax-width allowing more customization by jrquick17\n\n[2.1.0]\nReleased\n\nAngular 9 and 10 compatible version by jrquick17\n\n[2.0.0]\nReleased\n\nAngular 8 compatible version by jrquick17\n\n[1.0.0]\nReleased\n\nAngular 7 compatible version by jrquick17\nAdd vertical option by jrquick17\n\nCreated\n\nAngular component by mandhu\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"coverage.html":{"url":"coverage.html","title":"coverage - coverage","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n    Documentation coverage\n\n\n\n    \n\n\n\n    \n        \n            File\n            Type\n            Identifier\n            Statements\n        \n    \n    \n    \n\n\n\n\n\n    new Tablesort(document.getElementById('coverage-table'));\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"dependencies.html":{"url":"dependencies.html","title":"package-dependencies - dependencies","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    \n        Peer dependencies\n    \n    \n    \n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"index.html":{"url":"index.html","title":"getting-started - index","body":"\n                   \n\nngx-number-spinner\n\n\n\n\nIndex\n\nAbout\nSetup\nDocumentation\nIssues\nContributing\nDeploy\n\nAbout\nThis is a light-weight Angular 7+ component for adding a number spinner to your project. \n\nTry out the demo to see it in action!\nVisit my website for other cool projects!\n\nSetup\nInstallation\n\nFor Angular 7: \n$ npm install ngx-number-spinner@^1.0.0 --save\nFor Angular 8+: \n$ npm install ngx-number-spinner --save\n\nInject\nAdd NumberPickerModule to AppModule\nimport { BrowserModule } from '@angular/platform-browser';\nimport { NgModule } from '@angular/core';\n\nimport { AppComponent } from './app.component';\n\nimport { NgxNumberSpinnerModule } from 'ngx-number-spinner';\n\n@NgModule({\n  declarations: [\n    AppComponent\n  ],\n  imports: [\n    BrowserModule,\n    NgxNumberSpinnerModule\n  ],\n  providers: [],\n  bootstrap: [\n    AppComponent\n  ]\n})\nexport class AppModule { }Documentation\nStandalone Examples\nexport class AppComponent {\n    change(value: number): void {\n        console.log(value);\n    }\n}With validation 'MIN' value (min=1)\n\nWith validation 'MAX' value (min=9)\n\nWith validation 'MIN' and 'MAX' value (min=1, max=9)\n\nWith 'STEP' (step=5)\n\n\nForm Example\nimport { FormBuilder, FormGroup, FormControl } from '@angular/forms';\n\nexport class AppComponent {\n    form: FormGroup;\n\n    constructor(private fb: FormBuilder) {\n        this.form = this.fb.group({\n            price: 11\n        });\n    }\n\n    submit() {\n        alert(JSON.stringify(this.form.value));\n    }\n}\n    \n\n    submit\n\nComponent Inputs and Outputs\n\n\n\n\nAttribute\nType\nRequired\nDefault\nDescription\n\n\n\n\nvalue\n[input] number\nNo\n0\ninitial value for the spinner\n\n\nmin\n[input] number\nNo\nnull\nlimit the minimal number\n\n\nmax\n[input] number\nNo\nnull\nlimit the maximum number\n\n\nspin\n[input] number\nNo\n1\nincrement or decrement by current number\n\n\nvertical\n[input] vertical\nhorizontal\nNo\nhorizontal\n\n\n(change)\n(output) number\nno\n-\nemits the value of the current number, every time the user clicks the - or + button\n\n\n-------------------------------------------------------------------------------------------------------\n\n\n\n\n\n\n\nIssues\nIf you find any issues feel free to open a request in the Issues tab. If I have the time I will try to solve any issues but cannot make any guarantees. Feel free to contribute yourself.\nContributing\nTo contribute, clone the repo. Then, run npm install to get the packages needed for the library to work.\nThanks\n\nmandhu\njrquick17\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"license.html":{"url":"license.html","title":"getting-started - license","body":"\n                   \n\nMIT License\nCopyright (c) 2017-2018 Sibiraj\nCopyright (c) 2019 Jeremy Quick\nPermission is hereby granted, free of charge, to any person obtaining a copy\nof this software and associated documentation files (the \"Software\"), to deal\nin the Software without restriction, including without limitation the rights\nto use, copy, modify, merge, publish, distribute, sublicense, and/or sell\ncopies of the Software, and to permit persons to whom the Software is\nfurnished to do so, subject to the following conditions:\nThe above copyright notice and this permission notice shall be included in all\ncopies or substantial portions of the Software.\nTHE SOFTWARE IS PROVIDED \"AS IS\", WITHOUT WARRANTY OF ANY KIND, EXPRESS OR\nIMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES OF MERCHANTABILITY,\nFITNESS FOR A PARTICULAR PURPOSE AND NONINFRINGEMENT. IN NO EVENT SHALL THE\nAUTHORS OR COPYRIGHT HOLDERS BE LIABLE FOR ANY CLAIM, DAMAGES OR OTHER\nLIABILITY, WHETHER IN AN ACTION OF CONTRACT, TORT OR OTHERWISE, ARISING FROM,\nOUT OF OR IN CONNECTION WITH THE SOFTWARE OR THE USE OR OTHER DEALINGS IN THE\nSOFTWARE.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules.html":{"url":"modules.html","title":"modules - modules","body":"\n                   \n\n\n\n\n    Modules\n\n\n    \n    \n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"overview.html":{"url":"overview.html","title":"overview - overview","body":"\n                   \n\n\n\n    Overview\n\n    \n\n    \n    \n\n\n \n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"}}
